import React from 'react';
import styles from './Card.module.css';
const wizzards = 
 [
    {
      "name": "Harry",
      "lastName": "Potter",
      "healthPoints": 100,
      "manaPoints": 100,
      "status": "active"
    },
   
    {
      "name": "Sirius",
      "lastName": "Snake",
      "healthPoints": 100,
      "manaPoints": 1000,
      "status": "active"
    },

    {
        "name": "Hermiona",
        "lastName": "Granger",
        "healthPoints": 100,
        "manaPoints": 1000,
        "status": "active"
      }
  ]

export default function Card() {
  return (
          <>
            <div className={styles.card}>
               <h2 className={styles.card__name}>имя</h2>
               <h2 className={styles.card__health}>здоровье</h2>
               <h2 className={styles.card__mana}>мана</h2>
            </div>
          </>
  );
}
